import React from 'react';
import '../css/Feed.css'
import Post from './Post.js';
import UploadFileButton from './Button.js'
import JSON from './dummy.json'


class Feed extends React.Component {
    constructor(){
        super()
        this.state = {
            
        }
    }

    render(){
        return(
            <div  className="feed-div">
                <div className="posts-div">

                    {JSON.map( (data, index) => {
                        return(
                            <Spring
                            config = {{delay: 5000, tension: 100}}
                            from={{ opacity: 0 }}
                            to={{ opacity: 1 }}>
                            {props => 
                            <div style={props}>
                                <div className="button-div" onClick={() => setModalShow(true)}>
                                <Post title={data.title} key={index}></Post>

                                </div>
                            </div>
                            }
                        </Spring>  
                        
                        )
                    } )}

                </div>

                <div className="button-div">
                    <UploadFileButton></UploadFileButton>
                </div>
            </div>
        )
    }
}


export default Feed
